import Header from "../Layout/Header";
import Sidebar from "../Layout/Sidebar";
import { Outlet } from "react-router-dom";

const RootLayout = () =>{
    return(
        <div className="w-full md:flex">
            <Header />
            <Sidebar />
            <section className="flex flex-1 h-full">
                <Outlet />
            </section>
        </div>
    )
}

export default RootLayout;
